      Object.entries(data).forEach(([field, value]) => {
        handleInputChange(section, field, value);
      });
    });
  };

  return (
    <Container maxWidth="lg">
      <Box sx={{ my: 4 }}>
        <Typography 
          variant="h4" 
          component="h1" 
          gutterBottom
          sx={{ color: '#fff' }}
        >
          Research Paper Matcher
        </Typography>

        <ProfileManager 
          onLoadProfile={handleLoadProfile}
          currentProfile={formData}
        />

        <Card sx={{ mb: 3 }}>
          <CardContent>
            <Typography variant="h5" gutterBottom>
              Upload Papers
            </Typography>
            <PaperUpload />
          </CardContent>
        </Card>

        <Card sx={{ mb: 3 }}>
          <CardContent>
            <Typography variant="h5" gutterBottom>
              Enter Profile
            </Typography>
            <ProfileForm 
              onProfileSubmit={(profile) => setCurrentProfile(profile)}
              onMatchResults={(results) => setMatches(results)}
            />
          </CardContent>
        </Card>

        {matches && (
          <Card>
            <CardContent>
              <Typography variant="h5" gutterBottom>
                Matching Results
              </Typography>
              <MatchResults matches={matches} />
            </CardContent>
          </Card>
        )}
      </Box>
    </Container>
  );
}

export default App;
